import ExpenseItem from "./components/ExpenseItem";

function App() {
  // const parag = document.createElement('p')
  // parag.textContent ='This is also visible!'
  // document.getElementById('root').append(parag);
  //4,5 ve 6. satirlarda yazan kismi alt tarafta html kodu olarak <p>This is also visible!</p> sekilde yazabiliyoruz
  const expenses = [
    {id:'e1',title:'Car Insurance', amount:220.73, date:new Date(2022, 6, 1)},
    {id:'e2',title:'new TV', amount:350.36, date:new Date(2022, 6, 1)},
    {id:'e3',title:'motorbike', amount:9220.73, date:new Date(2022, 6, 1)},
    {id:'e4',title:'Phone', amount:1220.73, date:new Date(2022, 6, 1)}
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem title={expenses[1].title} amount={expenses[1].amount} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem title={expenses[2].title} amount={expenses[2].amount} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem title={expenses[3].title} amount={expenses[3].amount} date={expenses[0].date}></ExpenseItem>
    </div>
  );
}

export default App;
